import React from "react";
import "./Projects.css";

const Projects = () => {
  return (
    <div className="projectsContainer">
      <p>I've worked on</p>
      <div className="project">
        <p>
          <span>Mobile Price Prediction Using Random Forest Algorithm</span>
          <br />
          An ML model, which considers the features of a mobile and suggest a
          price for it.
        </p>
      </div>
      <div className="project">
        <p>
          <span>The Thianzu</span>
          <br />A web application that gives an overview of cultures and traditions of Indian states.
        </p>
      </div>
      <div className="project">
        <p> <span></span> E-Plastic Management System</p>
      </div>
      <div className="project">
        <p>Portfolio</p>
      </div>
    </div>
  );
};

export default Projects;
